import React from 'react';
import './App.css';
import Tabs from './components/Tabs'


function App() {
  return (
    <div className="App">
      <h1 stlye={{'text-align': 'center'}}>The tabs</h1>
      <Tabs>
        <div label="All cats">
          <div>
            <h2>The cats Api goes here</h2>
          </div>
        </div>
        <div label="Filter by:">
          <div>
            <h2>Then I have to figure out how to filter them</h2>
          </div>
        </div>
      </Tabs>
    </div>
  );
}

export default App;
